import MobileMenu from './components/MobileMenu';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <MobileMenu />
        <main className='active'>


        </main>
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
